import React from "react";

import { Helmet } from "react-helmet";
const Error404 = () => {
  return (
    <div>
      <Helmet>
        <title>404 PAGE NOT FOUND</title>
      </Helmet>
      <section className="background_dark_off">404 PAGE NOT FOUND</section>
    </div>
  );
};

export default Error404;
